import React from "react";

export default function ServiceCard (props){
    return (
        <a className="service-card">
            <div className="flex justify-center items-center">
                <div className="">
                    {props.svg}
                </div>
                <div className="font-bold">
                    {props.heading}
                </div>
            </div>
            {props.description}
        </a>
    );
}
